INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (155, 8, "人助けが大好き！　前向き格闘娘", 0, "トゥインクルウィッシュ", "東山奈央", 2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "獣人族", 100101, "ヒヨリ", 27, 16, "人助け、応援", "A", 44);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (158, 4, "戦闘のサポートが得意な、心優しい少女", 0, "トゥインクルウィッシュ", "種田梨沙", 2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ヒューマン", 100201, "ユイ", 5, 17, "料理、人間観察", "O", 47);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (163, 1, "クールで何事にも真っ直ぐな剣士", 0, "トゥインクルウィッシュ", "早見沙織", 2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "魔族", 100301, "レイ", 12, 18, "読書、乗馬、お茶", "B", 46);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (128, 8, "探検好きのイタズラっ子", 0, "リトルリリカル", "諸星すみれ", 5, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "ヒューマン", 100401, "ミソギ", 10, 9, "いたずら、探検", "O", 27);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (146, 11, "ヒーローに憧れる騎士見習いの少女", 0, "王宮騎士団（NIGHTMARE）", "下田麻美", 8, "？？？", "獣人族", 100501, "マツリ", 25, 12, "ヒーローごっこ", "O", 40);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (150, 11, "甘え上手なみんなの人気者", 0, "悪魔偽王国軍（ディアボロス）", "浅倉杏美", 7, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "魔族", 100601, "アカリ", 22, 13, "サックス", "O", 42);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (130, 1, "プリン大好きゴースト娘", 0, "悪魔偽王国軍（ディアボロス）", "雨宮天", 7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "魔族", 100701, "ミヤコ", 23, 14, "プリンを食べること", "B", 32);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (150, 10, "ボクは誰よりも美しい", 0, "ヴァイスフリューゲル　ランドソル支部", "大空直美", 15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "エルフ", 100801, "ユキ", 10, 14, "鏡で自分を見ること", "AB", 40);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (159, 7, "前世を信じる中二病患者、「疾風の冥姫」", 0, "トワイライトキャラバン", "髙野麻美", 13, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "魔族", 100901, "アンナ", 5, 17, "小説執筆", "A", 45);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (155, 9, "マホマホ王国のプリンセス", 0, "自警団（カォン）", "内田真礼", 10, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "獣人族", 101001, "マホ", 22, 16, "空想、ぬいぐるみ集め", "O", 42);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (156, 8, "人懐っこくてマシンガントークな妹系少女", 0, "ラビリンス", "阿澄佳奈", 3, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "ヒューマン", 101101, "リノ", 25, 15, "お裁縫", "A", 44);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (156, 12, "みんなのために超能力を使う眠り姫", 0, "フォレスティエ", "大橋彩香", 6, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "エルフ", 101201, "ハツネ", 24, 17, "妹と遊ぶこと、二度寝、昼寝、早寝", "A", 46);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (166, 8, "オタク全開な魔法少女", 0, "トワイライトキャラバン", "佳村はるか", 13, "", "魔族", 101301, "ナナカ", 21, 18, "読書、魔法", "O", 55);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (152, 11, "頭脳明晰な美少女名探偵", 0, "自警団（カォン）", "水瀬いのり", 10, "test", "獣人族", 101401, "カスミ", 3, 15, "読書、推理", "AB", 41);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (165, 9, "母性溢れる優しいみんなの「ミサト先生」", 0, "フォレスティエ", "國府田マリ子", 6, "test", "エルフ", 101501, "ミサト", 5, 21, "絵本作り", "O", 54);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (167, 4, "天真爛漫で人気者のカリスマモデル", 0, "ルーセント学院", "上坂すみれ", 14, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "魔族", 101601, "スズナ", 10, 18, "ファッション", "O", 48);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (158, 7, "いつでも「なんくるないさ～」な天然娘", 0, "自警団（カォン）", "高森奈津美", 10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "獣人族", 101701, "カオリ", 7, 19, "踊り、空手", "A", 53);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (162, 8, "多くの男性を魅了する無垢な女教師", 0, "ルーセント学院", "伊藤静", 14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "魔族", 101801, "イオ", 14, 23, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "B", 52);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (117, 4, "お歌もにんじんも、ウサギさんも大好き♪", 0, "リトルリリカル", "日高里菜", 5, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "獣人族", 102001, "ミミ", 3, 10, "かわいいもの集め", "O", 21);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (150, 6, "泣き虫で臆病な守ってあげたい女の子", 0, "サレンディア救護院", "植田佳奈", 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "ヒューマン", 102101, "クルミ", 9, 12, "観劇、おままごと", "B", 40);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (150, 11, "人見知りであまのじゃくな女の子", 0, "悪魔偽王国軍（ディアボロス）", "原紗友里", 7, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "魔族", 102201, "ヨリ", 22, 13, "ゲーム全般", "O", 40);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (148, 5, "ぷうきちといつも一緒！", 0, "サレンディア救護院", "芹澤優", 9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ヒューマン", 102301, "アヤネ", 10, 14, "屋内でできる遊び", "B", 38);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (154, 12, "お嬢さまのためにがんばるドジっ娘メイド", 0, "サレンディア救護院", "悠木碧", 9, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "ヒューマン", 102501, "スズメ", 12, 15, "ご奉仕", "O", 43);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (144, 1, "遊びと睡眠が何より大事なぐうたら娘", 0, "牧場（エリザベスパーク）", "小岩井ことり", 11, "test", "獣人族", 102601, "リン", 1, 17, "あんパン", "B", 42);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (154, 7, "運命の相手に一途すぎる乙女", 0, "トワイライトキャラバン", "橋本ちなみ", 13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "魔族", 102701, "エリコ", 30, 16, "実験、裁縫、料理", "B", 43);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (156, 10, "救護院を経営する優しい庶民派お嬢様", 0, "サレンディア救護院", "堀江由衣", 9, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "エルフ", 102801, "サレン", 4, 17, "経営、お茶会", "A", 43);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (157, 1, "歌って踊れる大人気アイドル", 0, "カルミナ", "日笠陽子", 4, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "ヒューマン", 102901, "ノゾミ", 24, 17, "舞台鑑賞、ダンス", "B", 40);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (163, 8, "トーゴクの神秘、オシエテクダサイ！", 0, "ヴァイスフリューゲル　ランドソル支部", "佐藤聡美", 15, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ヒューマン", 103001, "ニノン", 31, 16, "忍法開発", "O", 51);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (157, 12, "占いが得意な霊能少女", 0, "悪魔偽王国軍（ディアボロス）", "大坪由佳", 7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "魔族", 103101, "シノブ", 22, 18, "占い", "AB", 42);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (157, 3, "一人前の商人を目指すパワフルお嬢様", 0, "メルクリウス財団", "松嵜麗", 12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "ヒューマン", 103201, "アキノ", 12, 18, "慈善事業", "AB", 45);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (142, 3, "みんなを笑顔にするお笑い牧場主", 0, "牧場（エリザベスパーク）", "新田恵海", 11, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "ヒューマン", 103301, "マヒル", 3, 20, "漫才", "B", 35);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (164, 3, "純情でほっとけない大人の女性", 0, "メルクリウス財団", "今井麻美", 12, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "エルフ", 103401, "ユカリ", 16, 22, "ウインドーショッピング", "A", 55);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (118, 2, "礼儀正しくしっかり者のちびっ子優等生", 0, "リトルリリカル", "小倉唯", 5, "test", "エルフ", 103601, "キョウカ", 2, 8, "お勉強", "A", 21);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (149, 8, "義理堅くてからかい好きな剣術少女", 0, "王宮騎士団（NIGHTMARE）", "茅原実里", 8, "test", "ヒューマン", 103701, "トモ", 11, 13, "剣術、年長者をからかう", "A", 43);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (153, 11, "読書が趣味の病弱少女", 0, "牧場（エリザベスパーク）", "小清水亜美", 11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "獣人族", 103801, "シオリ", 3, 14, "読書、お散歩", "A", 40);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (158, 6, "「友達」に憧れる、エルフの森の女の子", 0, "フォレスティエ", "花澤香菜", 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "エルフ", 104001, "アオイ", 6, 13, "友達作りのイメトレ", "AB", 44);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (163, 6, "人々を守るために歌う、唱喚士の少女", 0, "カルミナ", "福原綾香", 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "ヒューマン", 104201, "チカ", 3, 17, "各種楽器", "O", 46);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (168, 8, "男勝りで情に厚いワイルド娘", 0, "自警団（カォン）", "小松未可子", 10, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "獣人族", 104301, "マコト", 9, 17, "お菓子作り", "O", 54);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (172, 5, "かつては夜を支配した最強の吸血鬼", 0, "悪魔偽王国軍（ディアボロス）", "丹下桜", 7, "test", "魔族", 104401, "イリヤ", 5, "??", "世界征服", "A", 50);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (157, 11, "妄想大好き！　ほんとは照れ屋な女の子", 0, "ヴァイスフリューゲル　ランドソル支部", "長妻樹里", 15, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "ヒューマン", 104501, "クウカ", 19, 18, "小説を読むこと", "AB", 49);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (158, 3, "弱きを助け強きをくじく猫娘", 0, "メルクリウス財団", "沼倉愛美", 12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "獣人族", 104601, "タマキ", 1, 18, "猫とたわむれること", "AB", 48);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (171, 10, "素顔を見せない冷静沈着な女性騎士", 0, "王宮騎士団（NIGHTMARE）", "川澄綾子", 8, "？？？", "ヒューマン", 104701, "ジュン", 25, 25, "格闘技、湯浴み", "A", 50);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (163, 11, "仕事も私事も効率優先な傭兵少女", 0, "メルクリウス財団", "田所あずさ", 12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ヒューマン", 104801, "ミフユ", 11, 20, "傭兵などのアルバイト", "O", 49);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (168, 10, "お姉ちゃんがお世話してあげるからねっ！", 0, "ラビリンス", "生天目仁美", 3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ヒューマン", 104901, "シズル", 24, 18, "家事全般", "O", 54);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (120, 1, "ちょっとおませな恋に恋する女の子", 0, "ルーセント学院", "久野美咲", 14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "魔族", 105001, "ミサキ", 3, 11, "ファッション誌鑑賞、コスメ集め", "A", 22);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (166, 3, "実験が趣味の危険な科学者", 0, "トワイライトキャラバン", "三石琴乃", 13, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "ヒューマン", 105101, "ミツキ", 7, 27, "研究、実験", "A", 53);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (150, 3, "乙女チックなもふもふアニマル", 0, "牧場（エリザベスパーク）", "徳井青空", 11, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "獣人族", 105201, "リマ", 14, 18, "毛繕い、お喋り", "A", 100);
