INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (158, 3, "弱きを助け強きをくじく猫娘", 0, "メルクリウス財団", "沼倉愛美", 12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "獣人族", 107901, "タマキ（サマー）", 1, 18, "猫とたわむれること", "AB", 48);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (163, 11, "仕事も私事も効率優先な傭兵少女", 0, "メルクリウス財団", "田所あずさ", 12, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ヒューマン", 108001, "ミフユ（サマー）", 11, 20, "傭兵などのアルバイト", "O", 49);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (157, 12, "占いが得意な霊能少女", 0, "悪魔偽王国軍（ディアボロス）", "大坪由佳", 7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "魔族", 108101, "シノブ（ハロウィン）", 22, 18, "占い", "AB", 42);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (130, 1, "プリン大好きゴースト娘", 0, "悪魔偽王国軍（ディアボロス）", "雨宮天", 7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "魔族", 108201, "ミヤコ（ハロウィン）", 23, 14, "プリンを食べること", "B", 32);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (120, 1, "ちょっとおませな恋に恋する女の子", 0, "ルーセント学院", "久野美咲", 14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "魔族", 108301, "ミサキ（ハロウィン）", 3, 11, "ファッション誌鑑賞、コスメ集め", "A", 22);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (163, 6, "人々を守るために歌う、唱喚士の少女", 0, "カルミナ", "福原綾香", 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "ヒューマン", 108401, "チカ（クリスマス）", 3, 17, "各種楽器", "O", 46);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (150, 6, "泣き虫で臆病な守ってあげたい女の子", 0, "サレンディア救護院", "植田佳奈", 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "ヒューマン", 108501, "クルミ（クリスマス）", 9, 12, "観劇、おままごと", "B", 40);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (148, 5, "ぷうきちといつも一緒！", 0, "サレンディア救護院", "芹澤優", 9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ヒューマン", 108601, "アヤネ（クリスマス）", 10, 14, "屋内でできる遊び", "B", 38);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (155, 8, "人助けが大好き！　前向き格闘娘", 0, "トゥインクルウィッシュ", "東山奈央", 2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "獣人族", 108701, "ヒヨリ（ニューイヤー）", 27, 16, "人助け、応援", "A", 44);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (158, 4, "戦闘のサポートが得意な、心優しい少女", 0, "トゥインクルウィッシュ", "種田梨沙", 2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ヒューマン", 108801, "ユイ（ニューイヤー）", 5, 17, "料理、人間観察", "O", 47);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (163, 1, "クールで何事にも真っ直ぐな剣士", 0, "トゥインクルウィッシュ", "早見沙織", 2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "魔族", 108901, "レイ（ニューイヤー）", 12, 18, "読書、乗馬、お茶", "B", 46);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (154, 7, "運命の相手に一途すぎる乙女", 0, "トワイライトキャラバン", "橋本ちなみ", 13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "魔族", 109001, "エリコ（バレンタイン）", 30, 16, "実験、裁縫、料理", "B", 43);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (168, 10, "お姉ちゃんがお世話してあげるからねっ！", 0, "ラビリンス", "生天目仁美", 3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ヒューマン", 109101, "シズル（バレンタイン）", 24, 18, "家事全般", "O", 54);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (156, 12, "英霊と契約を結んだマナリアの天才王女", 0, "？？？", "日笠陽子", "", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "ヒューマン", 109201, "アン", 1, 17, "読書", "AB", 55);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (144, 2, "マナリア魔法学院の新入生", 0, "？？？", "こやまきみこ", "", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "ヒューマン", 109301, "ルゥ", 4, 15, "食べること、眠ること", "O", 45);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (167, 11, "人を超越した力を有す心優しい竜姫", 0, "？？？", "福原綾香", "", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "半人半竜", 109401, "グレア", 3, 17, "ピアノ", "B", 67);
