INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (163, 6, "人々を守るために歌う、唱喚士の少女", 0, "カルミナ", "福原綾香", 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "ヒューマン", 117301, "チカ（サマー）", 3, 17, "各種楽器", "O", 46);
