INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (158, 7, "いつでも「なんくるないさ～」な天然娘", 0, "自警団（カォン）", "高森奈津美", 10, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "獣人族", 117701, "カオリ（ハロウィン）", 7, 19, "踊り、空手", "A", 53);
